%[text] # Portfolio Optimization with MATLAB
%[text] 
%[text] TODO:
%[text] - risk constraints
%[text] - real-world execution 
%[text] - backtesting and benchmark \
%[text] 
clear; clc; close all;
%[text] ## Read Data
opts = detectImportOptions('sp500_prices_10yr.csv');
opts.VariableNamesLine = 2;

sp500_prices = readtable('sp500_prices_10yr.csv', opts); %[output:6e36b26d]
sp500_prices %[output:99b372bf]
sp500_prices.Properties.VariableNames{1} = 'Date';
sp500_prices(1,:) = [];
sp500_prices(:,2:10) = [];

sp500_prices %[output:54575ad7]
%%
%[text] ## Format Data
sp500_prices(:,504:end) = []; % delete 5 OHLCV fields to only have close prices

% convert all text to numeric
for v = 2:width(sp500_prices)
    if iscell(sp500_prices.(v))
        sp500_prices.(v) = str2double(sp500_prices.(v));
    end
end

dates = sp500_prices{:,1}; 
prices = sp500_prices{:,2:end}; % T x N matrix
prices = prices(:, ~any(isnan(prices)));

[T_raw, N] = size(prices);

prices %[output:7bd4fa4d]
%%
%[text] ## Compute Returns
R = diff(log(prices)); 
T = size(R,1);

dates = dates(2:end);
%%
%[text] ## Construct Market Factor F
F = mean(R, 2);
K = 1;

% Basic expected returns estimate (historical mean)
mu = mean(R,1)';
%%
%[text] ## OLS Regression
%[text] Model: R = 1\*alpha' + F \* B' + E
X = [ones(T,1), F];
theta = (X' * X) \ (X' * R);
alpha_hat = theta(1,:).';
B_hat = theta(2:end,:).';

R_hat = X * theta;
E_hat = R - R_hat;
%%
%[text] ## Covariance Matrix
%[text] SigmaR = B \* SigmaF \* B' + SigmaE
SigmaF = cov(F);
specVar = var(E_hat, 0, 1);
SigmaE = diag(specVar);
SigmaR = B_hat * SigmaF * B_hat' + SigmaE %[output:64453453]
%%
%[text] ## Mean-Variance Optimization
one = ones(N,1);
invSigmaR = chol(SigmaR, 'lower') \ eye(N); 

w_minvar = (invSigmaR * one) / (one' * invSigmaR * one);

% Portfolio stats
mu_minvar = mu' * w_minvar;
var_minvar = w_minvar' * SigmaR * w_minvar;
std_minvar = sqrt(var_minvar);

fprintf('Unconstrained min-var portfolio: E[R]=%.4f, Std=%.4f\n', mu_minvar, std_minvar); %[output:3687b4ef]
%%
%[text] ## Efficient Frontier
A = one' * invSigmaR * one;
B = one' * invSigmaR * mu;
C = mu'  * invSigmaR * mu;
D = A*C - B^2;

nGrid = 50;
mu_target_vec = linspace(min(mu), max(mu), nGrid);
sigma_vec = zeros(nGrid,1);

w_store_uncon = zeros(N, nGrid);  % store weights for later analysis

for i = 1:nGrid
    mu_t = mu_target_vec(i);

    % Lagrange multipliers (lambda1, lambda2) solution
    lambda1 = (C - B*mu_t) / D;
    lambda2 = (A*mu_t - B) / D;

    w = invSigmaR * (lambda1 * one + lambda2 * mu);
    w_store_uncon(:,i) = w;

    sigma_vec(i) = sqrt(w' * SigmaR * w);
end

% Plot unconstrained efficient frontier
figure; %[output:089567c5]
plot(sigma_vec, mu_target_vec, '-'); %[output:089567c5]
hold on; %[output:089567c5]
plot(std_minvar, mu_minvar, 'o', 'MarkerFaceColor','auto'); %[output:089567c5]
xlabel('Portfolio Std Dev'); %[output:089567c5]
ylabel('Expected Return'); %[output:089567c5]
title('Efficient Frontier (Unconstrained)'); %[output:089567c5]
grid on; %[output:089567c5]
%%
%[text] ## PCA-based Factor Model
R_centered = R - mean(R,1);

% Covariance of returns
SigmaR_emp = cov(R_centered);    % N x N

% Eigen-decomposition: SigmaR_emp = V * D * V'
% (V columns: eigenvectors; D diagonal: eigenvalues)
[V, D] = eig(SigmaR_emp);

% Eigenvalues in ascending order; flip to get largest first
[eigvals, idx] = sort(diag(D), 'descend');
V = V(:, idx);

% Choose number of principal components K_pca
K_pca = 3;      % you can vary this

V_K = V(:, 1:K_pca);         % N x K_pca (loadings)
Lambda_K = diag(eigvals(1:K_pca));

% Approximate covariance by PCA K-factor model:
% SigmaR_pca = V_K * Lambda_K * V_K' + Psi
% where Psi is diagonal with remaining eigenvalues or residual diag.

% Simple choice: put remaining eigenvalues on diagonal of Psi
eig_rest = eigvals(K_pca+1:end);
Psi_diag = zeros(N,1);
if ~isempty(eig_rest)
    avg_rest = mean(eig_rest);
    Psi_diag = avg_rest * ones(N,1);  % crude approximation
end
Psi = diag(Psi_diag);

SigmaR_pca = V_K * Lambda_K * V_K' + Psi;

invSigmaR_pca = chol(SigmaR_pca, 'lower') \ eye(N);

w_minvar_pca = (invSigmaR_pca * one) / (one' * invSigmaR_pca * one);
mu_minvar_pca = mu' * w_minvar_pca;
std_minvar_pca = sqrt(w_minvar_pca' * SigmaR_pca * w_minvar_pca);

fprintf('\nPCA-based min-var portfolio: E[R]=%.4f, Std=%.4f\n', mu_minvar_pca, std_minvar_pca); %[output:600d354a]
% PCA-based efficient frontier (unconstrained)
sigma_pca = zeros(nGrid,1);

for i = 1:nGrid
    mu_t = mu_target_vec(i);

    A_p = one' * invSigmaR_pca * one;
    B_p = one' * invSigmaR_pca * mu;
    C_p = mu'  * invSigmaR_pca * mu;
    D_p = A_p*C_p - B_p^2;

    lambda1_p = (C_p - B_p*mu_t) / D_p;
    lambda2_p = (A_p*mu_t - B_p) / D_p;

    w_pca = invSigmaR_pca * (lambda1_p * one + lambda2_p * mu);
    sigma_pca(i) = sqrt(w_pca' * SigmaR_pca * w_pca);
end

% Plot comparison: original factor-model frontier vs PCA frontier
figure; %[output:9f0b6397]
plot(sigma_vec, mu_target_vec, '-', 'DisplayName','Factor model frontier'); %[output:9f0b6397]
hold on; %[output:9f0b6397]
plot(sigma_pca, mu_target_vec, '--', 'DisplayName','PCA frontier'); %[output:9f0b6397]
plot(std_minvar, mu_minvar, 'o', 'MarkerFaceColor','auto', 'DisplayName','Factor min-var'); %[output:9f0b6397]
plot(std_minvar_pca, mu_minvar_pca, 's', 'MarkerFaceColor','auto', 'DisplayName','PCA min-var'); %[output:9f0b6397]
xlabel('Portfolio Std Dev'); %[output:9f0b6397]
ylabel('Expected Return'); %[output:9f0b6397]
title('Factor Model vs PCA-Based Frontier'); %[output:9f0b6397]
legend('Location','best'); %[output:9f0b6397]
grid on; %[output:9f0b6397]

